package com.vertx.example.verticle

import cn.hutool.core.codec.Base64
import cn.hutool.core.util.HashUtil
import cn.hutool.log.StaticLog
import org.junit.jupiter.api.Test
import java.io.FileOutputStream

class ImageUtilsTest {
    @Test
    fun test() {
        val str =
            ""
        base64ToImage(str, "./test.png")
    }

    //定义函数,base64转图片
    fun base64ToImage(base64Str: String, path: String): Boolean {
        //对字节数组字符串进行Base64解码并生成图片
        //图像数据为空
        if (base64Str.isEmpty()) {
            StaticLog.error("base64转图片失败：base64为空")
            return false
        }
        try {
            //Base64解码
            val bytes = Base64.decode(base64Str)
            for (i in bytes.indices) {
                //调整异常数据
                if (bytes[i] < 0) {
                    bytes[i] = (bytes[i] + 256).toByte()
                }
            }
            //生成jpeg图片
            val out = FileOutputStream(path)
            out.write(bytes)
            out.flush()
            out.close()
        } catch (e: Exception) {
            StaticLog.error(e, "base64转图片失败")
            return false
        }
        return true
    }

    @Test
    fun hashTest() {
        val address = "Av. Paulista, 1000 - Bela Vista, São Paulo - SP, 01310-100巴西 "
        println(HashUtil.mixHash(address))
    }
}